import { StyleSheet, Text, View, TouchableHighlight } from 'react-native';
import { Check } from './Check';

export function Square(props) {
  return (
    <TouchableHighlight className="square" style={
      styles.rectangle
    } onPress={props.onClick}>
      <Check
        value={props.value}
      />
    </TouchableHighlight>
  )
}




const styles = {
  round: {
    width: 35,
    height: 35,
    borderRadius: "50%",
    // margin: "-0px",
    // margin: 10,
    // backgroundColor: "#558",
    // transform: 'rotate(275deg)',
  },
  rectangle: {
    width: 50,
    height: 50,
    margin: 10,
    backgroundColor: "rgba(201,140,2,1)",
    transform:  [{ rotate: "45deg" }],
  },
  cont_row: {
    display: "flex",
    flexDirection: "row",
  },
  bruh: {
    position: 'absolute',
    width: 350,
    height: 350,
    margin: 35,
    backgroundColor: "rgba(255,255,0,1)",
  },
  check: {
    height: "50px",
    width: "50px",
    backgroundColor: "#555",
    borderRadius: "50%",
  }
}
